import React from 'react';
import './about_us.css';

function AboutUs() {
    return (
        <section className="home_sect3">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="sect3_div1">
                            <div className="sect3_div2">
                                <h1>About</h1>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    );
}

export default AboutUs;
